import React, { useState, useEffect } from 'react';
import Container from './Container';

function Game() {
  const [player, setPlayer] = useState(1);

  const changePlayer = () => setPlayer(player === 1 ? 2 : 1);
  return <div>{<Container player={player} changePlayer={changePlayer} />}</div>;
}

export default Game;
